snippet.textDisplay:
dar-o-darichay kar kay band ghar kay,
                    vo yehi barha kahtain hain mujhsay;

na tera ishq, na teray ahd-o-payma,
                    mayray dilko chuway na mujhpai chayay;

unhai zid aaj bhi vohi purani,
                   utar jain wafa kay rang saaray;

meri firat badalnay de na mujhko,
                   kahan toofaan jho mayra sach dhobo dey;

zamana ho tou ho dushman yakeen ka,
                  hoon waqif par azal say main wafa say;

ye mana darmiyaan kouch faasilay hain,
                  unhai lagta hai sab hai khatm kissay;

vo mujhko apnay hee honay main dhoondain,
                  paraay rasmoon kay hai kya ye na manay;

                                        kabhi vo aayina dekhain tou samjhain,
                                             na hona meray honay ka nishaan hai.
- Jazieray (jus for...)

